import React from 'react';

const StudentLogin = () => {
    return (
        <div>
            <h1>Student Login</h1>
            <form>
                <label>Roll No:</label>
                <input type="text" placeholder="Enter Roll No" />
                <br />
                <label>Date of Birth:</label>
                <input type="date" />
                <br />
                <button type="submit">Login</button>
            </form>
        </div>
    );
};

export default StudentLogin;
